INSERT INTO `field_data_body` (`entity_type`, `bundle`, `deleted`, `entity_id`, `revision_id`, `language`, `delta`, `body_value`, `body_summary`, `body_format`) VALUES
('node', 'course', 0, 1, 1, 'und', 0, 'Цей курс допоможе вам навчитися створювати веб сайти на основі системи керування контентом. Все, від скінування дизайну до підключення CMS. Цей курс дасть вам чудовий старт для фріланса або роботи в компанії.', '', 'filtered_html'),
('node', 'course', 0, 2, 2, 'und', 0, 'Необхідні та поглибленні знання в системах керування контентом. Якщо ви хочете робити вебсайти як професіонал, цей курс для вас. Особливості різних CMS, використання та написання плагінів та компонентів, інтеграція із соціальними мережами та третьосторонніми сервісами.', '', 'filtered_html'),
('node', 'course', 0, 3, 3, 'und', 0, 'Для тих хто хоче розвити свої базові навички в PHP. Курс заглиблюється в вивчення ООП, MVC та фреймворку Symfony.', '', 'filtered_html'),
('node', 'course', 0, 4, 4, 'und', 0, 'Java -- це основа ентерпрайз технологій. Ви ознайомитесь із мовою, базовою структурю SDK основами технологій на Java. Курс вимагає підвищеного рівня самостійної роботи але отриманні знання приносять особливу винагороду в роботі.', '', 'filtered_html'),
('node', 'course', 0, 5, 5, 'und', 0, 'Розробка під мобільні технології все більше набирає популярності. GeekHub починає із найпопулярнішої відкритої платформи Android.', '', 'filtered_html'),
('node', 'course', 0, 6, 6, 'und', 0, 'Щоб стати досвідченим менеджером проектів потрібні роки спроб та помилок. Geekhub дає вам можливість набути практичних навичок та уникнути неприємних ситуацій в реальній роботі. Ми навчимо вас розуміти бізнес, відносини із клієнтами і девелоперами і звичайно методології ведення проектів.', '', 'filtered_html'),
('node', 'course', 0, 7, 7, 'und', 0, 'Контроль якості проектів -- важлива частина процесу розробки. Цей курс навчить вас систематизувати та автоматизувати процес тестування, підвищити якість та швидкість виконання проектів в компанії.', '', 'filtered_html'),
('node', 'course', 0, 8, 8, 'und', 0, 'Нинішні ринкові умови вимагають робочого знання англійської мови і вільним використанням технічних термінів. Немає кращого місця щоб підтягнути ці навички, ніж курс Techical English на GeekHub! Курс викладає Tim Phipps, англієць із науковим ступенем у англійскій літературі.', '', 'filtered_html'),
('node', 'page', 0, 9, 9, 'und', 0, '<div class="about">\r\n         \r\n            <ul>\r\n                <li class="imgs"><img alt="img" src="/images/about.png"/></li>\r\n                <li>\r\n                    <p>GeekHub - це проект, що надає можливість талановитій молоді отримати практичні знання та навички в сфері розробки програмного забезпечення та IT вцілому. Команда Geekhub — це группа професіоналів в інформаційних технологіях, які готують слухачів курсів до успішної кар’єри в індустрії. Всі члени команди Geekhub працюють у провідних софтверних компаніях, кожного дня оновлюючи свої знання та навички інноваціями в інформаційних технологіях. Саме це дає змогу викладати виключно потрібний матеріал, що знадобиться при роботі в реальних виробничих умовах.</p></li>\r\n                <li>\r\n                    <p>Ми шукаємо мотивованих учнів та студентів, які мріють отримати професію в інформаційних технологіях, для інтенсивного практичного навчання з розробки веб та мобільних додатків. Ми хочемо щоб молоді таланти теж змогли приєднатись до спільноти професіоналів інформаційних технологій і створювали унікальні інтегровані продукти для поліпшення умов праці і життя людей навколо нас.</p>\r\n                    <p>Ми називаємо Geekhub “Open Source”, тому що саме ця ідеологія керує всією програмою. Все що ми робимо обертається навколо взаємовідносин між людьми. Курси Geekhub не коштують грошей, все що вимагається — це внутрішня мотивація та багато самостійної роботи.</p>\r\n                </li>\r\n                <li>\r\n                    <p>Якщо ви зацікавлені у співробітництві з GeekHub, або у вас є ідеї щодо того, як зробити GeekHub краще - будь-ласка, <a href="/?q=contacts">зв''яжіться з нами</a> будь яким зручним для вас шляхом.</p>\r\n                </li>\r\n            </ul>\r\n        </div>', '', 'full_html'),
('node', 'team', 0, 10, 10, 'und', 0, '<p>Працює з рядом технологій, включаючи Symfony, Drupal, jQuery, Compass CSS, HAML, etc.\r\n                        Майстерність Євгена стоїть за такими проектами як <a href="http://www.belvilla.nl/">Belvilla</a>, <a href="http://yesorno.ch/">Yes or No</a>, <a href="http://www.webshop.jongenvrij.nl/">Jongenvrij webshop</a>, <a href="http://usgovernmentauctions.net/">USGA</a> та багато інших. У Geekhub Євген викладає Advanced CMS.</p>', '', 'filtered_html'),
('node', 'team', 0, 11, 11, 'und', 0, '<p>Тимофій розвиває індустрію мобільних додатків. На його рахунку такі проекти як KandleFly, SecondChance, Yak Messenger, <a href="http://geekhub.ck.ua/">GeekHub</a>, <a href="http://www.maximsoftware.com/">MaximSoftware</a>, <a href="http://mclean-design.com/">MClean-design</a>, <a href="http://m2m.org.ua">M2M</a> та інші. В Geekhub Тимофій викладає Frontend + CMS.</p>', '', 'filtered_html'),
('node', 'team', 0, 12, 12, 'und', 0, '<p>У GeekHub викладає Advanced PHP.</p>', '', 'filtered_html'),
('node', 'team', 0, 13, 13, 'und', 0, '<p>Сергій займається питаннями інтерфейсів і обробки контенту, кастомними компонентами UI та інтеграцією андроїд аппів із зовнішніми сервісами. Сергій працював над такими проектами як <a href="https://market.android.com/details?id=com.sandsmedia.apps.mobile.android.jtj">Java Tech Journal</a>, <a href="https://market.android.com/details?id=com.sirma.mobile.bible.android">LifeChurch Android app</a> та <a href="https://market.android.com/details?id=com.masterofcode.android.yakchat">Yak messenger</a>. У GeekHub Сергій викладає Java for Android.</p>', '', 'filtered_html'),
('node', 'team', 0, 14, 14, 'und', 0, '<p>У GeekHub викладає Advanced PHP.</p>', '', 'filtered_html'),
('node', 'team', 0, 15, 15, 'und', 0, '<p>Нік займається розвитком бізнесу компанії Master of Code LLC. У складі Geekhub Нік викладає Project Management та працює над брендінгом та маркетингом проекту.</p>', '', 'filtered_html'),
('node', 'team', 0, 16, 16, 'und', 0, '<p>Валентин займається питаннями технічного забезпечення Geekhub.</p>', '', 'filtered_html'),
('node', 'team', 0, 17, 17, 'und', 0, '<p>Олег професiйно займаеться розробкою веб додаткiв на PHP з використанням сучасних фреймфоркiв. Адепт Symfony2. У GeekHub Олег викладає Advanced PHP.</p>', '', 'filtered_html'),
('node', 'team', 0, 18, 18, 'und', 0, '<p>Since gaining his CELTA teaching qualification, Tim has specialised in private English lessons, meeting a wide range of student needs. He now teaches at the ''Yazlingo'' language school. At Geekhub Tim leads the Technical English course.</p>', '', 'filtered_html'),
('node', 'team', 0, 19, 19, 'und', 0, '<p>Юрій працює із командою розробників веб та кросс-платформових мобільних технологій. Його нещодавні проекти включають у себе <a href="http://stickyalbums.com">stickyalbums.com</a>, <a href="http://chewy.com">chewy.com</a>. У GeekHub Юрій займається організацією та розвитком проекту.</p>', '', 'filtered_html'),
('node', 'team', 0, 20, 20, 'und', 0, '<p>В Geekhub Дмитро викладає Frontend + CMS.</p>', '', 'filtered_html'),
('node', 'team', 0, 21, 21, 'und', 0, '<p>У GeekHub викладає Quality Assurance.</p>', '', 'filtered_html'),
('node', 'team', 0, 22, 22, 'und', 0, '<p>Володимир є Java та Android розробником у SPD Ukraine. Його основний проект -- <a href="http://nimblecommerce.com">nimblecommerce.com</a> У GeekHub Володимир викладає Java for Web.</p>', '', 'filtered_html'),
('node', 'team', 0, 23, 23, 'und', 0, '<p>Back-end та front-end веб-розробник. Основні технології, з якими працює: Spring (MVC, Security), Hibernate, mySql, MongoDB, jQuery, Ext.js Хоббі включають сноуборд, музика, mobile development. У GeekHub Валерій викладає Java for Web.</p>', '', 'filtered_html'),
('node', 'team', 0, 24, 24, 'und', 0, ' <p>Богдан керує компанією SPD-Ukraine та займається її розвитком. Має більше ніж 10 років досвіду з Java. У складі GeekHub Богдан є викладачем та координатором групи Basic Java / Java for Web.</p>', '', 'filtered_html'),
('node', 'team', 0, 25, 25, 'und', 0, '<p>Володимир є старшим front-end та CMS розробником. Наразі працює із проектом <a href="http://sellanapp.com">SellanApp</a>. У GeekHub викладає Advanced CMS. </p>', '', 'filtered_html'),
('node', 'team', 0, 26, 26, 'und', 0, '<p>Альона працює менеджером проектів у компанії Master of Code LLC. У Geekhub Альона викладає Project Management. </p>', '', 'filtered_html'),
('node', 'team', 0, 27, 27, 'und', 0, '<p>Дмитро працює над проектом <a href="https://market.android.com/details?id=com.sirma.mobile.bible.android">LifeChurch Android app</a>. У GeekHub викладає Java for Android.</p>', '', 'filtered_html'),
('node', 'team', 0, 28, 28, 'und', 0, '<p>Сергій працює з такими технологіями як Symfony, Drupal, JS, Zend Framework, CodeIgniter. Його проекти включають InnoLaunch Platform, <a href="http://www.thevx.com/">The VX</a>, <a href="http://fundforgenderequality.unwomen.org/">Fund for Gender Equality</a>, <a href="http://untf.unwomen.org/">UN Trust Fund to End Violence Against Women</a>. У GeekHub Сергій викладає Advanced CMS.</p>', '', 'filtered_html'),
('node', 'team', 0, 29, 29, 'und', 0, '<p>Юра займається розробкою комерційних проектів на Java зі складною клієнт-серверною архітектурою. У GeekHub викладає Java for Web.</p>', '', 'filtered_html'),
('node', 'page', 0, 30, 30, 'und', 0, '<div class="contacts">\r\n            \r\n            <dl>\r\n                <dt class="map">\r\n                    <h3>Заходьте</h3>\r\n                </dt>\r\n                <dd class="map"><div id="map" style="width:382px; height:287px"><iframe width="382" height="287" frameborder="0" scrolling="no" marginheight="0" marginwidth="0" src="https://maps.google.com/maps?f=q&amp;source=s_q&amp;hl=uk&amp;geocode=&amp;q=%D1%83%D0%BA%D1%80%D0%B0%D0%B8%D0%BD%D1%8B,+%D0%A7%D0%B5%D1%80%D0%BA%D0%B0%D1%81%D0%B8,+%D0%B2%D1%83%D0%BB.+%D0%93%D0%BE%D1%80%D1%8C%D0%BA%D0%BE%D0%B3%D0%BE,+60&amp;aq=&amp;sll=37.0625,-95.677068&amp;sspn=57.030354,79.013672&amp;ie=UTF8&amp;hq=&amp;hnear=%D0%B2%D1%83%D0%BB.+%D0%93%D0%BE%D1%80%D1%8C%D0%BA%D0%BE%D0%B3%D0%BE,+60,+%D0%A7%D0%B5%D1%80%D0%BA%D0%B0%D1%81%D0%B8,+%D0%A7%D0%B5%D1%80%D0%BA%D0%B0%D1%81%D1%8C%D0%BA%D0%B0+%D0%BE%D0%B1%D0%BB%D0%B0%D1%81%D1%82%D1%8C,+%D0%A3%D0%BA%D1%80%D0%B0%D1%97%D0%BD%D0%B0&amp;t=m&amp;ll=49.422587,32.088532&amp;spn=0.00977,0.018239&amp;z=15&amp;iwloc=A&amp;output=embed"></iframe><br /></div></dd>\r\n                <dt>\r\n                    <h3>Звоніть</h3>\r\n                </dt>\r\n                <dd><img src="/images/phone.png" alt="phone" /></dd>\r\n                <dt>\r\n                    <h3>Пишіть</h3>\r\n                </dt>\r\n                <dd>\r\n                    <img src="/images/email.png" alt="email"/>\r\n                </dd>\r\n                <dt>\r\n                    <h3>Слідкуйте</h3>\r\n                </dt>\r\n                <dd>\r\n                    <ul>\r\n                        <li class="fb"><a href="http://www.facebook.com/pages/GeekHub/158983477520070">facebook</a></li>\r\n                        <li class="vk"><a href="http://vkontakte.ru/geekhub">vkontakte</a></li>\r\n                        <li class="tw"><a href="http://twitter.com/#!/geek_hub">twitter</a></li>\r\n                    </ul>\r\n                </dd>\r\n\r\n      