INSERT INTO `search_dataset` (`sid`, `type`, `data`, `reindex`) VALUES
(1, 'node', ' frontend cms цей курс допоможе вам навчитися створювати веб сайти на основі системи керування контентом все від скінування дизайну до підключення cms цей курс дасть вам чудовий старт для фріланса або роботи в компанії  ', 0),
(2, 'node', ' advanced cms необхідні та поглибленні знання в системах керування контентом якщо ви хочете робити вебсайти як професіонал цей курс для вас особливості різних cms використання та написання плагінів та компонентів інтеграція із соціальними мережами та третьосторонніми сервісами  ', 0),
(3, 'node', ' advanced php для тих хто хоче розвити свої базові навички в php курс заглиблюється в вивчення ооп mvc та фреймворку symfony  ', 0),
(4, 'node', ' basic java java це основа ентерпрайз технологій ви ознайомитесь із мовою базовою структурю sdk основами технологій на java курс вимагає підвищеного рівня самостійної роботи але отриманні знання приносять особливу винагороду в роботі  ', 0),
(5, 'node', ' java for android розробка під мобільні технології все більше набирає популярності geekhub починає із найпопулярнішої відкритої платформи android  ', 0),
(6, 'node', ' project management щоб стати досвідченим менеджером проектів потрібні роки спроб та помилок geekhub дає вам можливість набути практичних навичок та уникнути неприємних ситуацій в реальній роботі ми навчимо вас розуміти бізнес відносини із клієнтами і девелоперами і звичайно методології ведення проектів  ', 0),
(7, 'node', ' quality assurance контроль якості проектів важлива частина процесу розробки цей курс навчить вас систематизувати та автоматизувати процес тестування підвищити якість та швидкість виконання проектів в компанії  ', 0),
(8, 'node', ' technical english нинішні ринкові умови вимагають робочого знання англійської мови і вільним використанням технічних термінів немає кращого місця щоб підтягнути ці навички ніж курс techical english на geekhub курс викладає tim phipps англієць із науковим ступенем у англійскій літературі  ', 0),
(9, 'node', ' про geekhub geekhub це проект що надає можливість талановитій молоді отримати практичні знання та навички в сфері розробки програмного забезпечення та it вцілому команда geekhub це группа професіоналів в інформаційних технологіях які готують слухачів курсів до успішної кар єри в індустрії всі члени команди geekhub працюють у провідних софтверних компаніях кожного дня оновлюючи свої знання та навички інноваціями в інформаційних технологіях саме це дає змогу викладати виключно потрібний матеріал що знадобиться при роботі в реальних виробничих умовах ми шукаємо мотивованих учнів та студентів які мріють отримати професію в інформаційних технологіях для інтенсивного практичного навчання з розробки веб та мобільних додатків ми хочемо щоб молоді таланти теж змогли приєднатись до спільноти професіоналів інформаційних технологій і створювали унікальні інтегровані продукти для поліпшення умов праці і життя людей навколо нас ми називаємо geekhub open source тому що саме ця ідеологія керує всією програмою все що ми робимо обертається навколо взаємовідносин між людьми курси geekhub не коштують грошей все що вимагається це внутрішня мотивація та багато самостійної роботи якщо ви зацікавлені у співробітництві з geekhub або у вас є ідеї щодо того як зробити geekhub краще будьласка  зв яжіться з нами будь яким зручним для вас шляхом  ', 0),
(10, 'node', ' євген jack григор єв працює з рядом технологій включаючи symfony drupal jquery compass css haml etc майстерність євгена стоїть за такими проектами як belvilla   yes or no   jongenvrij webshop   usga та багато інших у geekhub євген викладає advanced cms євген jack григор єв старший девелопер php в мaster of code  ', 0),
(11, 'node', ' тимофій common козак тимофій розвиває індустрію мобільних додатків на його рахунку такі проекти як kandlefly secondchance yak messenger  geekhub   maximsoftware   mcleandesign   m2m та інші в geekhub тимофій викладає frontend cms тимофій common козак iphone developer в master of code  ', 0),
(12, 'node', ' максим сторчовий у geekhub викладає advanced php максим сторчовий старший девелопер php в master of code  ', 0),
(13, 'node', ' сергій босовський сергій займається питаннями інтерфейсів і обробки контенту кастомними компонентами ui та інтеграцією андроїд аппів із зовнішніми сервісами сергій працював над такими проектами як java tech journal   lifechurch android app та yak messenger  у geekhub сергій викладає java for android сергій босовський старший android developer в master of code  ', 0),
(14, 'node', ' іван хижняк у geekhub викладає advanced php іван хижняк старший девелопер php  ', 0),
(15, 'node', ' нік курат нік займається розвитком бізнесу компанії master of code llc у складі geekhub нік викладає project management та працює над брендінгом та маркетингом проекту нік курат управляючий партнер в master of code  ', 0),
(16, 'node', ' валентин ярмолатій валентин займається питаннями технічного забезпечення geekhub валентин ярмолатій логістичний менеджер в master of code  ', 0),
(17, 'node', ' олег зінченко олег професiйно займаеться розробкою веб додаткiв на php з використанням сучасних фреймфоркiв адепт symfony2 у geekhub олег викладає advanced php олег зінченко teamlead в exercisecom  inc  ', 0),
