(23, 'node', ' валерій олексієнко backend та frontend веброзробник основні технології з якими працює spring mvc security hibernate mysql mongodb jquery extjs хоббі включають сноуборд музика mobile development у geekhub валерій викладає java for web валерій олексієнко веброзробник в spdukraine  ', 0),
